        her days settled into stirrups and a leather saddle, astride her favorite
        horse, Beau. Her photographs of ranching life belie, however, how much her
        world has changed in the past decade. In her former life, Jean was a casting
        director living in New York City, who had a passion for westward excursions
        to photograph the eccentric characters of the American West. Now she\u2019s
        living the life of the subjects she once documented. \u201cI never really
